import Chart from "../ChartBar/Chart";

const ExpensesChart=props=>{
    const datapoints=[
        {label:"Jan", value:0},
        {label:"Feb", value:1},
        {label:"Mar", value:2},
        {label:"Apr", value:3},,
        {label:"May", value:4},
        {label:"Jun", value:5},
        {label:"Jul", value:6},
        {label:"Aug", value:7},
        {label:"Sept", value:8},
        {label:"Oct", value:9},
        {label:"Nov", value:10},
        {label:"Dec", value:11}
    ]
    return(
        <Chart datapoints={datapoints}/>
    )
}

export default ExpensesChart;
